-- 6. Inserción de los usuarios a partir de la tabla temporal
-- 6.1. Todos los usuarios

INSERT INTO [Usuarios] ([idTipoUsuario], [correo], [clave])
SELECT  TU.[id],
        tmp_U.[correo],
        tmp_U.[clave]
FROM    @tmp_Usuarios tmp_U
INNER JOIN  [dbo].[TiposUsuario] TU
    ON  tmp_U.[tipoUsuario] = TU.[descripcion];

-- 6.2. Estudiantes

INSERT INTO [Estudiantes] ([idUsuario], [cedula], [carnet], [nombre], [apellido1], [apellido2], [fechaDeNacimiento], [activo], [eliminado])
SELECT  U.[id],
        tmp_U.[cedula], 
        tmp_U.[carnet], 
        tmp_U.[nombre], 
        tmp_U.[apellido1], 
        tmp_U.[apellido2], 
        tmp_U.[fechaNac],
        1,
        0
FROM    @tmp_Usuarios tmp_U
INNER JOIN  [dbo].[Usuarios] U
    ON  tmp_U.[correo] = U.[correo]
WHERE   tmp_U.[tipoUsuario] = 'Estudiante';

