INSERT INTO [dbo].[Reservas] ([idCubiculo], [idEstudiante], [fecha], [horaInicio], [horaFin], [activo], [confirmado], [eliminada])
SELECT  C.[id],
        E.[id],
        DATEADD(HOUR, 6, tmp_R.[fecha]),
        DATEADD(HOUR, 6, tmp_R.[horaInicio]),
        DATEADD(HOUR, 6, tmp_R.[horaFin]),
        tmp_R.[activo],
        tmp_R.[confirmado],
        0
FROM    @tmp_Reservas tmp_R
INNER JOIN  [dbo].[Cubiculos] C
    ON  C.[nombre] = tmp_R.[nombreC]
INNER JOIN  [dbo].[Estudiantes] E
    ON  tmp_R.[carnet] = E.[carnet];